import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

const Step2 = () => {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [vehicles, setVehicles] = useState([]);

  useEffect(() => {
    const fetchVehicles = async () => {
      try {
        const step2Data = JSON.parse(localStorage.getItem('step2Data'));
        const token = localStorage.getItem('token');

        const response = await axios.get(`https://calm-retreat-90846-cd036e8a822e.herokuapp.com/https://api.rentsyst.com/v2/booking/search`, {
          params: {
            date_from: step2Data.pickupDateTime,
            date_to: step2Data.returnDateTime,
            pickup_location: step2Data.selectedLocation,
            return_location: step2Data.selectedLocation
          },
          headers: {
            Authorization: `Bearer ${token}`
          }
        });

        console.log('Response data:', response.data);

        // Store the entire response data in the vehicles state
        setVehicles(response.data);
      } catch (error) {
        console.error('Error fetching vehicles:', error);
        setError('Failed to fetch vehicles: ' + error.message);
      } finally {
        setLoading(false);
      }
    };

    fetchVehicles();
  }, []);

  console.log('Loading:', loading);
  console.log('Error:', error);
  console.log('Vehicles:', vehicles);

  return (
    <div className="step2">
      <div className="catalog">
        <h2>Available Vehicles</h2>
        {loading && <p>Loading...</p>}
        {error && <p>{error}</p>}
        {!loading && !error && vehicles.available_vehicles && vehicles.available_vehicles.length === 0 && <p>No vehicles available</p>}
        {!loading && !error && vehicles.available_vehicles && vehicles.available_vehicles.length > 0 && (
          <div className="vehicle-list">
            {vehicles.available_vehicles.map(vehicle => (
              <div key={vehicle.id} className="vehicle-item">
                <div className="vehicle-thumbnail">
                  <img src={vehicle.thumbnail} alt={vehicle.mark} />
                </div>
                <div className="vehicle-details">
                  <h3>{vehicle.mark}</h3>
                  <p>Year: {vehicle.year}</p>
                  <p>Price: {vehicle.price} {vehicle.currency}</p>
                  {/* Add more vehicle details as needed */}
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default Step2;
